"use strict";

function f_gold(m, n, guards, walls) {
    let g = Array.from({ length: m }, () => Array(n).fill(null));
    for (let [r, c] of guards) {
        g[r][c] = 'g';
    }
    for (let [r, c] of walls) {
        g[r][c] = 'w';
    }
    for (let [i, j] of guards) {
        for (let [a, b] of [[0, -1], [0, 1], [1, 0], [-1, 0]]) {
            let [x, y] = [i, j];
            while (
                0 <= x + a && x + a < m &&
                0 <= y + b && y + b < n &&
                g[x + a][y + b] !== 'w' &&
                g[x + a][y + b] !== 'g'
            ) {
                x += a;
                y += b;
                g[x][y] = 'v';
            }
        }
    }
    return g.flat().filter(v => !v).length;
}
